import React from "react";
import { Navigate, Outlet } from "react-router-dom";

export default function ProtectedRoute({
  // eslint-disable-next-line no-useless-rename
  isAuth: isAuth,
}) {
  return (
    <>
      if (isAuth){<Outlet />}else {<Navigate to="/adminlogin" />}
    </>
  );
}
